INSERT INTO `products` VALUES (1,'對馬戰鬼','A123456761',NULL,1500,'由曾打造《惡名昭彰》系列的 Sucker Punch Productions 開發的日本武士開放世界遊戲，以 13 世紀對馬島為舞台，蒙古大軍來襲事件為背景，玩家將扮演大戰中唯一倖存的武士「境井仁」，為了抵抗蒙古大軍，他將化身為令敵人膽戰心驚的「戰鬼」，不擇手段拯救遭受蹂躪的家園與同胞。','巫師6',_binary 'data:image/jpeg;base64,','宜蘭縣','Switch','yes','yes','2020-08-17','西往母','no','2020-08-24');
INSERT INTO `products` VALUES (2,'紙片瑪利歐：摺紙國王','A123123123',NULL,1800,'《瑪利歐賽車 8 豪華版》是在 Wii U 主機上推出的《瑪利歐賽車 8》的加強版作品，內容收錄了《瑪利歐賽車 8》發售後推出的全部追加下載項目，並且再追加了新角色、賽道、車種和道具，帶來《瑪利歐賽車》系列最大的遊戲份量。','',_binary 'data:image/jpeg;base64,','','Switch','yes',NULL,'2020-08-17','李四端','yes','2020-08-24'),(6,'n集合啦！動物森友會','A123123123',NULL,1800,'系列最新作品重新詮釋動物之森的體驗方式，玩家參加「無人島移居計畫」，在以無人島為背景的遊戲中展開全新的生活。可以悠閒地在海邊漫步、四處探索，在什麼都沒有的無人島展開自由自在的生活。另外，還有全新改造系統，讓玩家可以 DIY，將島上的材料收集起來，DIY 成家具及生活所需的道具等等。享受園藝、釣魚、島上探索、居家環境佈置、與移居到島上的可愛動物們交流等多項體驗，讓玩家可以一面感受四季變化，一面享受悠閒生活。','巫師3+1',_binary 'data:image/jpeg;base64,','台北市','Switch','yes','yes','2020-08-17','李四端','yes','2020-08-20'),(9,'瑪利歐賽車 8 豪華版','A123456761',NULL,1500,'《瑪利歐賽車 8 豪華版》是在 Wii U 主機上推出的《瑪利歐賽車 8》的加強版作品，內容收錄了《瑪利歐賽車 8》發售後推出的全部追加下載項目，並且再追加了新角色、賽道、車種和道具，帶來《瑪利歐賽車','健身環大冒險',_binary 'data:image/jpeg;base64,','','Switch','yes','yes','2020-08-18','西王母','yes','2020-08-24'),(36,'健身環大冒險','A123456789',NULL,1880,'任天堂再出搭配體感的新招，遊戲伴隨推出的配件，充滿彈性的「健身環」。透過環內擠壓感測器感應玩家動作，藉由玩家自身的運動在遊戲中打敗怪獸。遊戲內以角色扮演的冒險模式為主，還有額外的健身小遊戲和健身鍛鍊模','皮再養',_binary 'data:image/jpeg;base64,','','Switch','yes','yes','2020-08-20','吳大頭','no','2020-08-24'),(37,'集合啦！動物森友會','A123456789',NULL,2000,'系列最新作品重新詮釋動物之森的體驗方式，玩家參加「無人島移居計畫」，在以無人島為背景的遊戲中展開全新的生活。可以悠閒地在海邊漫步、四處探索，在什麼都沒有的無人島展開自由自在的生活。另外，還有全新改造系','薩爾達 或是 類似的RPG',_binary 'data:image/jpeg;base64,','','Switch','yes','yes','2020-08-20','吳大頭','yes','2020-08-24');
